import React from "react";
import s from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className="dialogs">
      {" "}
      Dialogs
      <div className="dialogs_item">
        <ul>
          <li>
            <a href="">Dimych</a>
          </li>
        </ul>
        <ul>
          <li>
            <a href="">Gluk</a>
          </li>
        </ul>
        <ul>
          <li>
            <a href="">Sasha</a>
          </li>
        </ul>
        <ul>
          <li>
            <a href="">Viktor</a>
          </li>
        </ul>
        <ul>
          <li>
            <a href="">Valera</a>
          </li>
        </ul>
      </div>
      <div className="messages">
        <div className="message_item">hi</div>
        <div className="message_item">you</div>
        <div className="message_item">what</div>
      </div>
    </div>
  );
};

